 }\n\ntd,\nth {\n  padding: 0;\n  text-align: left; }\n","$body-background-color: #fff !default;\n$body-size: 16px !default;\n$body-rendering: optimizeLegibility !default;\n$body-family: $family-sans-serif !default;\n$body-color: $text !default;\n$body-weight: $weight-normal !default;\n$body-line-height: 1.5 !default;\n\n$code-family: $family-monospace !default;\n$code-padding: 0.25em 0.5em 0.25em !default;\n$code-weight: normal !default;\n$code-size: 0.875em !default;\n\n$hr-background-color: $border !default;\n$hr-height: 1px !default;\n$hr-margin: 1.5rem 0 !default;\n\n$strong-color: $text-strong !default;\n$strong-weight: $weight-bold !default;\n\nhtml {\n  background-color: $body-background-color;\n  font-size: $body-size;\n  -moz-osx-font-smoothing: grayscale;\n  -webkit-font-smoothing: antialiased;\n  min-width: 300px;\n  overflow-x: hidden;\n  overflow-y: scroll;\n  text-rendering: $body-rendering; }\n\narticle,\naside,\nfigure,\nfooter,\nheader,\nhgroup,\nsection {\n  display: block; }\n\nbody,\nbutton,\ninput,\nselect,\ntextarea {\n  font-family: $body-family; }\n\ncode,\npre {\n  -moz-osx-font-smoothing: auto;\n  -webkit-font-smoothing: auto;\n  font-family: $code-family; }\n\nbody {\n  color: $body-color;\n  font-size: 1rem;\n  font-weight: $body-weight;\n  line-height: $body-line-height; }\n\n// Inline\n\na {\n  color: $link;\n  cursor: pointer;\n  text-decoration: none;\n  strong {\n    color: currentColor; }\n  &:hover {\n    color: $link-hover; } }\n\ncode {\n  background-color: $code-background;\n  color: $code;\n  font-size: $code-size;\n  font-weight: $code-weight;\n  padding: $code-padding; }\n\nhr {\n  background-color: $hr-background-color;\n  border: none;\n  display: block;\n  height: $hr-height;\n  margin: $hr-margin; }\n\nimg {\n  height: auto;\n  max-width: 100%; }\n\ninput[type=\"checkbox\"],\ninput[type=\"radio\"] {\n  vertical-align: baseline; }\n\nsmall {\n  font-size: 0.875em; }\n\nspan {\n  font-style: inherit;\n  font-weight: inherit; }\n\nstrong {\n  color: $strong-color;\n  font-weight: $strong-weight; }\n\n// Block\n\npre {\n  background-color: $pre-background;\n  color: $pre;\n  font-size: 0.875em;\n  white-space: pre;\n  word-wrap: normal;\n  code {\n    @include overflow-touch;\n    background: none;\n    color: inherit;\n    display: block;\n    font-size: 1em;\n    overflow-x: auto;\n    padding: 1.25rem 1.5rem; } }\n\ntable {\n  td,\n  th {\n    text-align: left;\n    vertical-align: top; }\n  th {\n    color: $text-strong; } }\n","// Colors\n\n$black:        hsl(0, 0%, 4%) !default;\n$black-bis:    hsl(0, 0%, 7%) !default;\n$black-ter:    hsl(0, 0%, 14%) !default;\n\n$grey-darker:  hsl(0, 0%, 21%) !default;\n$grey-dark:    hsl(0, 0%, 29%) !default;\n$grey:         hsl(0, 0%, 48%) !default;\n$grey-light:   hsl(0, 0%, 71%) !default;\n$grey-lighter: hsl(0, 0%, 86%) !default;\n\n$white-ter:    hsl(0, 0%, 96%) !default;\n$white-bis:    hsl(0, 0%, 98%) !default;\n$white:        hsl(0, 0%, 100%) !default;\n\n$orange:       hsl(14,  100%, 53%) !default;\n$yellow:       hsl(48,  100%, 67%) !default;\n$green:        hsl(141, 71%,  48%) !default;\n$turquoise:    hsl(171, 100%, 41%) !default;\n$blue:         hsl(217, 71%,  53%) !default;\n$purple:       hsl(271, 100%, 71%) !default;\n$red:          hsl(348, 100%, 61%) !default;\n\n// Typography\n\n$family-sans-serif: BlinkMacSystemFont, -apple-system, \"Segoe UI\", \"Roboto\", \"Oxygen\", \"Ubuntu\", \"Cantarell\", \"Fira Sans\", \"Droid Sans\", \"Helvetica Neue\", \"Helvetica\", \"Arial\", sans-serif !default;\n$family-monospace: monospace !default;\n$render-mode: optimizeLegibility !default;\n\n$size-1: 3rem !default;\n$size-2: 2.5rem !default;\n$size-3: 2rem !default;\n$size-4: 1.5rem !default;\n$size-5: 1.25rem !default;\n$size-6: 1rem !default;\n$size-7: 0.75rem !default;\n\n$weight-light: 300 !default;\n$weight-normal: 400 !default;\n$weight-medium: 500 !default;\n$weight-semibold: 600 !default;\n$weight-bold: 700 !default;\n\n// Responsiveness\n\n// The container gap, which acts as the offset for breakpoints\n$gap: 24px !default;\n// 960, 1152, and 1344 have been chosen because they are divisible by both 12 and 16\n$tablet: 769px !default;\n// 960px container + 3rem\n$desktop: 960px + (2 * $gap) !default;\n// 1152px container + 3rem\n$widescreen: 1152px + (2 * $gap)  !default;\n// 1344px container + 3rem\n$fullhd: 1344px + (2 * $gap)  !default;\n\n// Miscellaneous\n\n$easing: ease-out !default;\n$radius-small: 2px !default;\n$radius: 3px !default;\n$radius-large: 5px !default;\n$speed: 86ms !default;\n","@mixin arrow($color) {\n  border: 1px solid $color;\n  border-right: 0;\n  border-top: 0;\n  content: \" \";\n  display: block;\n  height: 0.5em;\n  pointer-events: none;\n  position: absolute;\n  transform: rotate(-45deg);\n  width: 0.5em; }\n\n@mixin block {\n  &:not(:last-child) {\n    margin-bottom: 1.5rem; } }\n\n@mixin clearfix {\n  &:after {\n    clear: both;\n    content: \" \";\n    display: table; } }\n\n@mixin center($width, $height: 0) {\n  position: absolute;\n  @if $height != 0 {\n    left: calc(50% - (#{$width} / 2));\n    top: calc(50% - (#{$height} / 2)); }\n  @else {\n    left: calc(50% - (#{$width} / 2));\n    top: calc(50% - (#{$width} / 2)); } }\n\n@mixin delete {\n  @include unselectable;\n  -moz-appearance: none;\n  -webkit-appearance: none;\n  background-color: rgba($black, 0.2);\n  border: none;\n  border-radius: 290486px;\n  cursor: pointer;\n  display: inline-block;\n  flex-grow: 0;\n  flex-shrink: 0;\n  font-size: $size-normal;\n  height: 20px;\n  max-height: 20px;\n  max-width: 20px;\n  min-height: 20px;\n  min-width: 20px;\n  outline: none;\n  position: relative;\n  vertical-align: top;\n  width: 20px;\n  &:before,\n  &:after {\n    background-color: $white;\n    content: \"\";\n    display: block;\n    left: 50%;\n    position: absolute;\n    top: 50%;\n    transform: translateX(-50%) translateY(-50%) rotate(45deg);\n    transform-origin: center center; }\n  &:before {